import React from 'react';

const Button = () => {
    return (
        <div className="ml-[30px] mt-[15px] text-center bg-white w-[152px] h-[40px] rounded-[10px] text-black text-sm font-bold font-['Roboto'] leading-[15px] tracking-tight flex justify-center ">
            <p>Добавить виджет</p>
        </div>
    );
};

export default Button;
